    [],nt"revision_timestamp": "2016-10-03T21:22:36.861363",nt"name": "coastal-change-analysis-program-c-cap-high-resolution-land-cover-and-change-data30318",nt"isopen":
    false,nt"url": null,nt"notes": "The NOAA Coastal Change Analysis Program
    (C-CAP) produces national standardized high resolution land cover and change products
    for the coastal regions of the U.S. and its Territories. C-CAP products inventory
    coastal intertidal areas, wetlands, and adjacent uplands with the goal of monitoring
    changes in these habitats. The timeframe for this metadata is reported as 1945 -
    2012. These maps are developed utilizing various sources of commercial satellite
    and aerial imagery of varying resolutions, and can be used to track changes in the
    landscape through time. This trend information gives important feedback to managers
    on the success or failure of management policies and programs and aid in developing
    a scientific understanding of the Earth system and its response to natural and human-induced
    changes. This understanding allows for the prediction of impacts due to these changes
    and the assessment of their cumulative effects, helping coastal resource managers
    make more informed regional decisions.",nt"license_title": null,nt"extras":
